import { useState } from 'react';
import Header from './Header';
import SideBare from './SideBar';
import Categorie from './Categorie';
import Fichier from './Fichier';
import Statut from './Statut';
import Vote from './Vote';
import CreePost from './PosteCreator';
import PosteList from './PosteList';

function App() {

   const [posts,setpost] = useState([
      {title:'',id_vote:5,id_dossier:'',date:'',Type:'vote'},
      {id_fichier:'',id_dossier:'',notes:'',fichier:'',date:'',Type:''},
      {id_note:'',description:'',id_dossier:'',date:'',Type:''}
   ]);

  return <>
      <Header/>
      <SideBare/>
      <Categorie/>
      <Fichier/>
      <Statut/>
      <Vote/>
      <div className='postes'>
         <PosteList posts={posts}/>
      </div>
      <CreePost/>

      </>;
}

export default App;
